function findChampion(grid: number[][]): number {
    const n = grid.length;

    // Iterate over each team
    for (let i = 0; i < n; i++) {
        let isChampion = true;

        // Check if the current team is stronger than all other teams
        for (let j = 0; j < n; j++) {
            if (i !== j && grid[i][j] === 0) {
                isChampion = false;
                break;
            }
        }

        // If the team is stronger than all others, return it as the champion
        if (isChampion) {
            return i;
        }
    }

    // If no champion is found (though the problem constraints guarantee one exists)
    return -1;
};

// Example usage
console.log(findChampion([[0,1],[0,0]])); // Output: 0
console.log(findChampion([[0,0,1],[1,0,1],[0,0,0]])); // Output: 1
